// App.js
import React from "react";
import "./App.css";

function App() {
  return (
    <Router>
    <div>
      <nav>

          <li>
            <Link to="/">Home</Link>
          </li>
          </nav>
    </div>
    {/* Route definitions */}
    <Route path="Home.js" exact component={Home} />
    </Router>
  );
}

export default App;
